import React from 'react';
import "../card.css"
import data from "../data.json"




export default function Card() {
  return (
    data.map((dados) => {
      return (
        
 <div className="container">
      <div className='card card1'>
        <img src={dados.logo } alt="" />
        <div className='descript-left'>
          <div className="descript-cabecalho">
            <span>{dados.company}</span> <span>{dados.new}</span> <span>{dados.Vagas.featured }</span>
          </div>

          <div className="title">
            <h4>{data.Vagas.position}</h4>
          </div>

          <div className='descript-footer'>
            <span>{data.Vagas.postedAt}</span> <span>{data.Vagas.contract}</span> <span>{data.Vagas.location }</span>
          </div>

        </div>

        <div className='descript-right'>
          <span>{data.Vagas.role}</span>  <span>{data.Vagas.level}</span>  <span>{data.Vagas.languages}</span>
        </div>

      </div >

    </div>
      )
    })

   
  );
}
